import styled from "styled-components";

export const StyledUtilDescription = styled.div`
  background-color: #787787;
  color: #fff;
  width: 350px;
  margin: 0 auto;
  padding: 25px;
  margin-bottom: 20px;
  box-sizing: border-box;

  strong {
    font-family: "Literata", serif;
    font-size: 1.4rem;
    font-weight: 400;
  }

  p {
    text-align: left;
    font-size: 0.9rem;
  }

  a {
    color: #ebdac0;
    text-decoration: none;

    :hover {
      color: #c1b29c;
    }
  }
`;
